    useState([]);
  useEffect(() => {
    const calling = async () => {
      const re = await fetch(
        "../data/products.json",
        { credentials: "same-origin" }
      );
      return re;
    };
    const aa = async () => {
      const d = await calling();
      debugger;
    };
    aa();
  }, []);

  return (
    <div>
      <ul>
        {products.map((p) => (
          <li>{p.name}</li>
        ))}
      </ul>
    </div>
  );
}
